import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../config/fire";
import * as firebase from "firebase";
// import Studentprofile from '../components/Studentprofile';

export default class Student extends Component {
  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: ""
    };
  }


  loginCheck = (e) => {
    e.preventDefault();
    console.log(this.state.email);
    
   

    // console.log("Functioncalled");
  };


  

  render() {
    // var emailchk = this.state.email;
    // var passwordchk = this.state.password;
    return (
      <div>


        <div className="cmd">
          <label>
            <h2>student log</h2>
          </label>
          {/* //pass variables of email and password and update the value of those variables when the value in textfield changes*/}
          {/* <form onSubmit={(e) => this.loginCheck(e, emailchk, passwordchk)}> */}
          <form onSubmit={this.loginCheck}>

            <input
              type="text"
              name="username"
              placeholder="email"
              required
              onChange={e => this.setState({ email: e.target.value })}
            />

            <br />

            <input
              type="password"
              name="password"
              placeholder="Password"
              required
              onChange={e => this.setState({ password: e.target.value })}
            />

            <br />

            <input type="submit" value="Login"></input>
          </form>
        </div>

        {/*just for testing  */}
        <div>
          <Link to="/student/studentprofile" className="sbtn">
            <button className="sbtn">student profile</button>
          </Link>
        </div>
      </div>
    );
  }
}
